// 43A - Football// https://codeforces.com/problemset/problem/43/A import java.util.HashMap;import java.util.Map;import java.util.Scanner; public class CF43A {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        int n = sc.nextInt();        Map<String, Integer> match = new HashMap<>();        for (int i = 0; i < n; i++) {            String team = sc.next();            if (match.containsKey(team)) {                match.put(team, match.get(team) + 1);            } else {                match.put(team, 1);            }        }        String winningTeam = "";        int maxScore = 0;        for (Map.Entry<String, Integer> i : match.entrySet()        ) {            if (i.getValue() > maxScore) {                maxScore = i.getValue();                winningTeam = i.getKey();            }        }        System.out.println(winningTeam);        sc.close();    }}
